    <p class="texto-info" style="margin-top: 50px;">Hola a todos! Soy Martín Contreras, un programador inquieto con una fuerte afición hacia las nuevas tecnologías, el desarrollo de <span>Sitios Webs Dinámicos</span> y la creación de <span>Aplicaciones Personalizadas</span>. <br> <br> Me inicié en el mundo de la programación estudiando como ingeniero electrónico, lo que me llevó a aprender mucha<br> lógica de programación en lenguajes como <span>C, C++</span> y algo de <span>Bash</span> obviamente</span>.<br><br> Esto me despertó una curiosidad por aprender y saber como se crean exactamente programas y/o aplicaciones web usando lenguajes como <span>PHP, HTML5, CSS3, JavaScript</span>.<br>Luego empecé a interesarme en la modularización de código, y terminé estudiando mi primer <span>Framework</span> como es <span>Laravel en PHP</span> <br> para aprender a diseñar webs completas desde cero pero ahora de manera más simple y robusta.<br>Actualmente me encuentro desarrollando distintos proyectos, tanto para la universidad como proyectos personales que me ayuden<br> a seguir perfeccionando mi stack.<br><br>Me gusta mucho desarrollar webs desde cero utilizando ambos paradigmas de programación como son el procedural y Programación Orientada a Objetos (POO) y también soy muy autodidácta cuando se trata de aprender cosas nuevas.<br>
