    <div class="projects" id="projects-container">

      <!-- Proyecto 1 KUDAY -->
      <div class="project-card" data-aos="fade-up">
        <div class="project-image">
          <img src="imagenes/proyectos/kudaycarrito.png" alt="Kuday Store">
        </div>
        <div class="project-content">
          <h3 class="project-title">Kuday Store</h3>
          <p class="project-description">Proyecto creado para una tienda virtual de tipo <span>e-commerce</span> de diversos artículos y totalmente responsive.<br>Tiene en su desarrollo distintas tecnologías aplicadas, pero me centré en aprender y aplicar el uso de <span>PHP</span> para automatizar desde un panel de administración de stock, el despliegue de todos los items de la tienda en tiempo real con una base de datos <span>MySQL</span> integrada <span>(CMS + ERP lightweight)</span><br>También utilicé funciones avanzadas de <span>Javascript</span> para el manejo de articulos en el carrito, y en la parte del Backend gran parte del código fue estructurado con <span>programacion procedural</span><br> El proyecto contiene distintas versiones con respecto a la gestión de las ventas, la última versión integra una <span>Pasarela de Pagos</span> con <span>MercadoPago</span> y <span>Webhooks</span> para la actualización de estados de las órdenes de compra.
          </p>


