      <div class="project-card">
        <div class="project-image">
          <img src="imagenes/proyectos/productoslistas.png" alt="Catalogo Laravel">
        </div>
        <div class="project-content">
          <h3 class="project-title">CRUD en Laravel 12</h3>
          <p class="project-description">
            Este proyecto es una aplicación web desarrollada en <span>Laravel 12</span> con arquitectura <span>MVC</span>, enfocada en la gestión de marcas, productos (con imágenes) y categorías. La construcción se realizó principalmente desde la terminal con <span>Artisan</span>, generando migraciones, modelos, controladores, seeders, etc, aplicando las convenciones de Laravel para mantener orden y escalabilidad.<br> En el backend, se implementó un <span>CRUD completo con controladores RESTful</span> (index, create, store, edit, update, destroy),<span>manejo de rutas</span> (view, get, post, put, delete) y uso de <span>MySQL</span> como base de datos. Los controladores retornan datos a las vistas con with() y se aplicaron <span>validaciones de formularios</span> con mensajes de errores dinámicos.<br> Para las vistas se utilizó <span>Blade</span>, con layouts y components reutilizables, además de directivas como <span>@csrf y @method()</span>. El frontend se potenció con Vite y NPM para la compilación de assets.<br> La capa de datos combina <span>Eloquent ORM y Query Builder</span>, con relaciones entre entidades y <span>paginación nativa de Laravel</span>. También se incluyó la subida de imágenes y redirecciones con mensajes flash para mejorar la experiencia del usuario.
          </p>

