        <div class="project-content">
          <h3 class="project-title">Fatto in Casa</h3>
          <p class="project-description">Fatto in Casa es un Sistema Web tipo <span>Landing Page</span>, desarrollado en <span>PHP y MySQL</span>, diseñado especialmente para emprendimientos de catering y gastronomía. El sitio permite mostrar eventos y menús de manera dinámica, con todas sus características cargadas desde una base de datos, y facilita la contratación directa a través de redes sociales.<br> Se utilizó <span>composer</span> para gestionar ciertas dependencias y <span>Bootstrap 5</span> para el diseño responsivo, asegurando una experiencia de usuario óptima en todos los dispositivos.<br> Se creó también un <span>Panel Administrativo</span> robusto con manejo de <span>Sesiones</span> y con la experiencia atractiva de una landing page, permitiendo a los emprendedores de catering mostrar su oferta de manera profesional y eficiente.
          </p>

