          <h3 class="project-title">PHP Avanzado: Funciones, Seguridad y POO</h3>
          <p class="project-description">Este proyecto es una recopilación práctica de <span>funciones y métodos avanzados en PHP</span>, orientado al aprendizaje y la implementación de técnicas útiles en el desarrollo web. Incluye ejemplos aplicados en diferentes áreas clave:<br> <span>Manejo de Fechas</span> y el uso de funciones nativas para formatear, calcular y manipular fechas y horas.<br>Creación de <span>Ficheros y Directorios</span>, manipulación y creación de <span>Imágenes y Thumbnails</span>, aplicación de marcas de agua para protección de contenido y manipulación gráfica con <span>PHP</span>.<br>Integración de <span>Captcha</span>, <span>reCaptcha de Google</span> y captchas personalizados para prevenir accesos automatizados.<br> <span>Programación Orientada a Objetos (POO)</span>: creación y gestión de clases y objetos para un código más estructurado y reutilizable.<br><span>Consultas seguras con PDO</span> e implementación de <span>sentencias preparadas</span> para reforzar la seguridad y prevenir ataques como <span>SQL Injection</span>.
          </p>

