  <!--    SCRIPT PARA COPIAR EMAIL  -->
  <script>
    const btnCopiar = document.getElementById('btn-copiar');
    const inputCorreo = document.getElementById('correo');
    const mensajeCopiado = document.getElementById('mensaje-copiado');

    btnCopiar.addEventListener('click', () => {
      // Selecciona el contenido del input
      inputCorreo.select();
      inputCorreo.setSelectionRange(0, 99999); // Compatibilidad con móviles

      // Copia el texto al portapapeles
      navigator.clipboard.writeText(inputCorreo.value)
        .then(() => {
          // Muestra el mensaje de "¡Copiado!"
          mensajeCopiado.classList.add('visible');

          // Oculta el mensaje después de 2 segundos
          setTimeout(() => {
            mensajeCopiado.classList.remove('visible');
          }, 2000);
        })
        .catch(err => console.error('Error al copiar: ', err));
    });
  </script>


  <!--    SCRIPT CON JS PARA ESCONDER LA BARRA AL HACER SCROLL  -->
  <script>
    let lastScrollTop = 0;
    const navbar = document.querySelector('.navbar');
    let ticking = false; // Para evitar que el evento dispare demasiadas veces

    window.addEventListener('scroll', function() {
      if (!ticking) {
        window.requestAnimationFrame(() => {
          let scrollTop = window.pageYOffset || document.documentElement.scrollTop;

          if (scrollTop > lastScrollTop) {
            // Scroll hacia abajo → Ocultar navbar
            navbar.style.transform = 'translateY(-150%)';
          } else {
            // Scroll hacia arriba → Mostrar navbar
            navbar.style.transition = 'transform 0.6s ease-in-out';
            navbar.style.transform = 'translateY(0)';
          }

          lastScrollTop = scrollTop <= 0 ? 0 : scrollTop; // Evita valores negativos
          ticking = false;
        });
        ticking = true;
      }
    });
  </script>


  <!--    SCRIPT CON JS PARA HACER UN TEXTO DINÁMICO  -->
  <script>
    // Textos que queremos mostrar
    const texts = [
      "Desarrollador Fullstack ",
      "PHP Developer ",
      "Front End Designer ",
      "Back End Developer "
    ];

    let index = 0;
    const textElement = document.querySelector(".text-din"); // Contenedor del texto
    const cursorElement = document.querySelector(".cursor"); // Cursor

    function typeText() {
      const currentText = texts[index]; // texto actual
      textElement.textContent = ""; // limpiamos la cadena de texto

      let charIndex = 0; // indice del primer caracter
      const typingInterval = setInterval(() => {

        if (charIndex < currentText.length) {

          textElement.textContent += currentText.charAt(charIndex); // sumamos una letra
          charIndex++; //incrementamos el indice

        } else {
          clearInterval(typingInterval); // Finaliza el tipado

          // Espera 2 segs y cambia al siguiente texto
          setTimeout(() => {
            index = (index + 1) % texts.length; // Cicla entre los textos
            typeText(); // Repite la animación
          }, 2000); // Espera 2 segundos antes de cambiar
        }
      }, 100); // Velocidad de tipado
    }

    // Iniciar la animación
    typeText();
  </script>

