  <!-- Script para pagination -->
  <script>
    document.addEventListener("DOMContentLoaded", () => {
      const itemsPerPage = 3; // máximo 3 proyectos
      const projects = document.querySelectorAll(".project-card");
      const totalPages = Math.ceil(projects.length / itemsPerPage);
      const pagination = document.getElementById("pagination");
      let currentPage = 1;

      function showPage(page) {
        projects.forEach(p => p.style.display = "none"); // ocultar todos

        const start = (page - 1) * itemsPerPage;
        const end = start + itemsPerPage;

        for (let i = start; i < end && i < projects.length; i++) {
          // projects[i].style.display = "block"; // ❌ esto forzaba block y rompía el flex
          projects[i].style.display = ""; // ✅ vuelve al display original definido en CSS (.project-card {display:flex})
        }

        // actualizar botones activos
        const buttons = document.querySelectorAll(".page-btn");
        buttons.forEach((btn, idx) => {
          btn.classList.toggle("active", idx + 1 === page);
        });

        // 👇 scroll al inicio de la sección
        const section = document.getElementById("Proyectos");
        section.scrollIntoView({
          behavior: "smooth"
        });

        // 👇 refrescar AOS para recalcular posiciones
        AOS.refresh();
      }

      // generar botones de paginación
      for (let i = 1; i <= totalPages; i++) {
        const btn = document.createElement("button");
        btn.innerText = i;
        btn.classList.add("page-btn");
        btn.addEventListener("click", () => {
          currentPage = i;
          showPage(currentPage);
        });
        pagination.appendChild(btn);
      }

      // mostrar primera página
      showPage(currentPage);
    });
  </script>


